        name:"kuberan"
    }]
    // const [SlideStyle,setSlideStyle]=useState("right:-100")
    const [disabled, setDisabled] = useState(false);
  const onChange = (checked) => {
    setDisabled(checked);
  };
    return ( 
        <UsersDiv>
             {userData.map(user => (
          <li key={user.name}> {user.name} <button>change</button> </li>  ))}
            <SlidingDiv>
                <SocialShareHeading>Social Share Setting</SocialShareHeading>
                <SocialShareFacebook>

                    <AutopostDiv>
                        <p>Allow Autopost</p>
                        <Switch checkedChildren={<CheckOutlined />} unCheckedChildren={<CloseOutlined />} defaultChecked/>
